@Pame_javiera @Danaerys12 Mis monos sí irán; pero no son pequeños, 3o medio y 8o básico.
Ella, 2 días cada semana; él, 1 semana cada 3; media jornada ambos. Ella caminará; él se moverá conmigo en transporte público.
Seremos cuidadosos y sabemos que tenemos muchos privilegios que dan relativa seguridad

